(1, 'aboutus', 'About News Portal', '<h3 style=\"text-align: justify; \"><font face=\"Helvetica\">Artikel ini mengulas keindahan dan kekayaan Jawa Timur dari tiga aspek utama: fashion, Pendidikan, dan wisata. Dalam bagian fashion, kami mengeksplorasi keunikan Batik Madura, kebaya khas Jawa Timur, dan busana adat Suku Tengger. Bagian Pendidikan membahas bagaimana perkembangan pendidikan di indonesia atau kualifikasinya. Sementara itu, bagian wisata membawa Anda menjelajahi destinasi menakjubkan seperti Gunung Bromo, Kawah Ijen, Taman Nasional Baluran, serta kota Malang dan Batu. Temukan pesona Jawa Timur yang memikat hati dalam setiap aspek kehidupan masyarakatnya.</font></h3>', '2024-01-14 18:30:00', '2024-06-15 03:36:01'),
(2, 'contactus', 'Contact Details', '<p><br></p><p><b>Address :&nbsp; Tantriii</b></p><p><b>Phone Number : </b>+0850-1234-5678</p><p><b>Email -id : tantrii@gmail.com</b></p>', '2024-01-15 18:30:00', '2024-06-14 06:43:55');

