(7, 'Jasprit Bumrah ruled out of England T20I series due to injury', 3, 4, '<p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\">The Indian Cricket Team has received a huge blow right ahead of the commencement of the much-awaited series against England. Star speedster Jasprit Bumrah has been ruled out of the forthcoming 3-match T20I series as he suffered an injury in his left thumb.</span></p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">The 24-year-old pacer picked up a niggle during India’s first T20I match against Ireland played on June 27 at the Malahide cricket ground in Dublin. As per the reports, he is likely to be available for the ODI series against England scheduled to start from July 12.</p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">In the first, Bumrah exhibited a phenomenal performance with the ball. In his quota of four overs, he conceded 19 runs and picked 2 wickets at an economy rate of 4.75.</p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">Post his injury, he arrived at team’s optional training session on Thursday but didn’t train. Later, he was rested in the second face-off along with MS Dhoni, Shikhar Dhawan and Bhuvneshwar Kumar.</p><p style=\"margin-bottom: 15px; padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">As of now, no replacement has been announced. However, Umesh Yadav may be be given chance in the team in Bumrah’s absence.</p><p style=\"padding: 0px; font-size: 16px; font-family: PTSans, sans-serif;\">The first T20I match between India and England will be played at Old Trafford, Manchester on July 3.</p>', '2024-01-15 18:30:00', '2024-06-14 05:02:04', 0, 'Jasprit-Bumrah-ruled-out-of-England-T20I-series-due-to-injury', '6d08a26c92cf30db69197a1fb7230626.jpg', 24, 'admin', NULL),
(12, 'Shah holds meeting with NE states leaders in Manipur', 6, 7, '<p><span style=\"color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\">New Delhi: BJP president Amit Shah today held meetings with his party leaders who are in-charge of 11 Lok Sabha seats spread across seven northeast states as part of a drive to ensure that it wins the maximum number of these constituencies in the general election next year.</span><br style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\"><br style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\"><webviewcontentdata style=\"box-sizing: inherit; color: rgb(25, 25, 25); font-family: &quot;Noto Serif&quot;; font-size: 16px;\">Shah held separate meetings with Lok Sabha toli (group) of Arunachal Pradesh, Tripura, Meghalaya, Mizoram, Nagaland, Sikkim and Manipur in Manipur, the partys media head Anil Baluni said.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\">Baluni said that Shah was in West Bengal for two days before he arrived in Manipur. The BJP chief would reach Odisha tomorrow.</webviewcontentdata><br></p>', '2024-01-17 18:30:00', '2024-06-14 05:02:14', 0, 'Shah-holds-meeting-with-NE-states-leaders-in-Manipur', '7fdc1a630c238af0815181f9faa190f5.jpg', 22, 'admin', NULL);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(14, ' Fashion Jawa Timur Keindahan dalam Warna dan Tradisi', 9, 11, '<h3 style=\"text-align: center; \">Fashion di Jawa Timur</h3><p style=\"text-align: center;\"><br></p><h4><font face=\"Times New Roman\">Jawa Timur, salah satu provinsi terbesar di Indonesia, memiliki kekayaan budaya yang tercermin dalam busana tradisionalnya. Beberapa elemen fashion khas dari Jawa Timur antara lain:</font></h4><h4><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Batik Madura:</font></h4><h4><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"Pakaian-Adat-Madura-Klasik-Modern.jpg\"><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Batik Madura dikenal dengan warna-warnanya yang cerah dan motif-motif yang berani. Berbeda dengan batik dari daerah lain yang biasanya menggunakan warna-warna lembut, batik Madura sering kali menampilkan warna merah, kuning, dan biru yang mencolok.<br></font><font face=\"Times New Roman\">Motif-motif batik Madura seringkali menggambarkan flora dan fauna, serta unsur-unsur alam lainnya yang mencerminkan kehidupan sehari-hari masyarakat Madura.</font></h4><h4><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Kebaya Jawa Timur:</font></h4><h4><img src=\"data:image/jpeg;base64,\" data-filename=\"jenis-kebaya-wisudajpeg-20211209114811.jpeg\" style=\"width: 50%;\"><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Kebaya khas Jawa Timur biasanya lebih sederhana dibandingkan dengan kebaya dari Jawa Tengah atau Jawa Barat, namun tetap elegan. Bahan yang digunakan biasanya adalah brokat atau kain tipis lainnya yang menambah kesan anggun bagi pemakainya.<br></font><font face=\"Times New Roman\">Kebaya ini sering dipadukan dengan kain batik sebagai bawahan, menciptakan perpaduan yang harmonis antara tradisi dan modernitas.</font></h4><h4><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Busana Adat Suku Tengger:</font></h4><h4><img src=\"data:image/webp;base64,\" data-filename=\"Baju-Pakem-Kange-Yune-Bojonegoro.webp\" style=\"width: 50%;\"><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Suku Tengger yang tinggal di sekitar kawasan Gunung Bromo memiliki pakaian adat yang khas. Mereka mengenakan sarung dan baju khas dengan motif-motif tradisional. Penutup kepala yang dikenakan oleh pria Tengger juga menjadi salah satu ciri khas busana adat mereka.</font></h4>', '2024-06-14 06:41:34', '2024-06-14 23:49:17', 1, '-Fashion-Jawa-Timur-Keindahan-dalam-Warna-dan-Tradisi', 'd7855b1f4a10a02c68aacd5c6be617f4.jpg', 2, 'admin', NULL);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(15, 'Wisata Jawa Timur Petualangan Alam dan Keajaiban Sejarah', 11, 13, '<h3 style=\"text-align: center; \"><font face=\"Arial Black\">Wisata di Jawa Timur</font></h3><h3 style=\"text-align: center; \"><font face=\"Arial Black\"><br></font></h3><p>Jawa Timur menawarkan berbagai destinasi wisata yang memukau, mulai dari pegunungan hingga pantai. Berikut adalah beberapa tempat wisata populer di Jawa Timur:</p><p>Gunung Bromo :</p><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"destination-bromo-960x636.jpg\"><br></p><p>Gunung Bromo adalah salah satu gunung berapi paling terkenal di Indonesia. Pemandangan matahari terbit dari Puncak Penanjakan adalah atraksi utama, menawarkan panorama spektakuler yang menarik ribuan wisatawan setiap tahunnya. Selain itu, lautan pasir yang luas dan kawah aktif Gunung Bromo juga menjadi daya tarik tersendiri.</p><p>Kawah Ijen :</p><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"Kawah-Ijen-AdobeStock_253456529.jpeg\"><br></p><p>Kawah Ijen terkenal dengan fenomena api biru (blue fire) yang hanya bisa ditemukan di dua tempat di dunia. Pendakian menuju Kawah Ijen menawarkan pemandangan alam yang indah dan menantang, serta pemandangan danau kawah dengan warna biru toska yang menakjubkan.</p><p>Taman Nasional Baluran :</p><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" data-filename=\"45ab9470f90cd5dd0780abea05167886.jpg\" style=\"width: 50%;\"><br></p><p>Dikenal sebagai \"Little Africa in Java\", Taman Nasional Baluran menawarkan pemandangan savana yang luas dan berbagai satwa liar seperti banteng, rusa, dan burung merak. Pantai Bama yang ada di kawasan taman nasional ini juga menawarkan keindahan tersendiri dengan air laut yang jernih dan terumbu karang yang menawan.</p><p>Kota Malang dan Batu :</p><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" data-filename=\"Alunalunbatu.jpg\" style=\"width: 50%;\"><br></p><p>Malang dan Batu adalah destinasi wisata yang terkenal dengan suasana sejuk dan berbagai atraksi wisata. Kota Batu memiliki banyak taman rekreasi seperti Jatim Park, Batu Night Spectacular (BNS), dan Museum Angkut. Sementara itu, Malang terkenal dengan kuliner dan kampung tematiknya seperti Kampung Warna-Warni dan Kampung Biru.</p>', '2024-06-15 00:06:10', '2024-06-15 00:07:49', 0, 'Wisata-Jawa-Timur-Petualangan-Alam-dan-Keajaiban-Sejarah', '480c6de4dda92ae1652278cfb656b4a0.jpg', 1, 'admin', NULL);
